import { useSearchParams } from 'react-router-dom';
import { useState } from 'react';
import './Menu.css';

function Menu() {
    const [searchParams] = useSearchParams();
    const whereToEat = searchParams.get('whereToEat');
    const menuKind = fetch('/api/kind').then(res => res.json()).then(data => data[0]);

    return (
        <>
            <header className='header'>{whereToEat}</header>
            <div className='menuKindSelector'>
                <select>
                    {menuKind.map(kind => <option key={kind}>{kind}</option>)}
                </select>
            </div>
        </>
    );
}

export default Menu;
